\",\"parenting 101\",\"alder hay\",\"alder hay hospital\",\"parenting tips\",\"crisis\",\"parenting styles\",\"tips for parents\",\"diet\",\"meat\",\"food\",\"parenting\",\"how to raise your children\",\"documemtaries\",\"children's hospital\",\"liverpool\",\"NHS\",\"Alder Hay Children's NHS Hospital\"],\"channelId\":\"UCnLZd2akioIjHHrze5atqqw\",\"isOwnerViewing\":false,\"shortDescription\":\"From obesity to alcohol misuse, from rotting baby teeth to hearing problems caused by passive smoking - Britain's largest children's hospital is treating younger and younger patients for health problems which are ultimately preventable. Many are the result of kids' lifestyles and are, according to the experts, causing them unnecessary suffering.\\n\\nWith unprecedented access to Alder Hey Children's Hospital in Liverpool, this documentary meets the kids, the pediatricians treating them and follows them home in an attempt to uncover the root cause of their problems. It is clear that some of the basic health messages from the doctors are not getting through to parents.\\n\\nThe A\\u0026E is a busy department and having to deal with cases such as drunk children is not only time consuming for staff, but can be upsetting for other young patients too. Operations on dental, glue ear and obesity cases are helping clog up a system that's already under considerable strain. The hospital estimates they spend around a million pounds a year on treating preventable conditions, enough to buy them a new MRI scanner.\\n\\nThe Good, the Bad \\u0026 the Messy – our channel features documentaries and shows about stories of modern parenting. Through a mixture of original \\u0026 archive content, we explore a range of captivating subjects; education styles, complex relationships, food habits, the challenges of large families…\\n\\nWant to see more wholesome and insightful content? Subscribe to our channel!\\nFollow us on Facebook -\\nhttps:\/\/www.facebook.com\/RealFamillies\/\\n \\nFollow us on Inst se, from rotting baby teeth to hearing problems caused by passive smoking - Britain's largest children's hospital is treating younger and younger patients for health problems which are ultimately preventable. Many are the result of kids' lifestyles and are, according to the experts, causing them unnecessary suffering.\n\nWith unprecedented access to Alder Hey Children's Hospital in Liverpool, this documentary meets the kids, the pediatricians treating them and follows them home in an attempt to uncover the root cause of their problems. It is clear that some of the basic health messages from the doctors are not getting through to parents.\n\nThe A\u0026E is a busy department and having to deal with cases such as drunk children is not only time consuming for staff, but can be upsetting for other young patients too. Operations on dental, glue ear and obesity cases are helping clog up a system that's already under considerable strain. The hospital estimates they spend around a million pounds a year on treating preventable conditions, enough to buy them a new MRI scanner.\n\nThe Good, the Bad \u0026 the Messy – our channel features documentaries and shows about stories of modern parenting. Through a mixture of original \u0026 archive content, we explore a range of captivating subjects; education styles, complex relationships, food habits, the challenges of large families…\n\nWant to see more wholesome and insightful content? Subscribe to our channel!\nFollow us on Facebook -\n"},{"text":"https://www.facebook.com/RealFamillies/","navigationEndpoint":{"clickTrackingParams":"CJcBEM2rARgBIhMI4_-_p5WT6gIV7sQRCB3F3gyySLnXium_vcKwcw==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?redir_token=7shfCJsI6R8bdcAgEiRwIz9HzA58MTU5MjgzNzc5MkAxNTkyNzUxMzky\u0026q=https%3A%2F%2Fwww.facebook.com%2FRealFamillies%2F\u0026event=video_description\u0026v=c2EJ6_0iq7k","rootVe":83769}},"urlEndpoint":{"url":"/redirect?redir_token=7shfCJsI6R8bdcAgEiRwIz9HzA58MTU5MjgzNzc5MkAxNTkyNzUxMz
